import "./App.css";
import YoutubeList from '../src/components/youtube/YoutubeList';
function App() {
  return (
   <div>
    <YoutubeList></YoutubeList>
   </div>
  );
}
export default function AppWrapper() {
  return (
    <Router>
      <NotificationProvider>
        <App />
      </NotificationProvider>
    </Router>
  );
}
